import React from 'react'
import { Link } from "react-router-dom";

export default function Navi() {
  var x="";
    const naviList = ["Hakkımızda" ,"Hizmetler", "İletişim", "Fiyat Listesi"]
   naviList[0] === "Hakkımızda"
? x= "Hakkimda" : null
  naviList[2] === "Hakkımızda"
? x= "Hakkimda" : null
 
    naviList.map((list)=> 
   <Link to={`/${x}`}><li className='float-left list-none pr-4 text-white'> {list}</li></Link>
    ) 
  
  
    
  return (  
  
    <div className='bg-slate-600 h-24'> 
    <div className='bg-slate-700 w-40 h-24 -mt-6 shadow-lg shadow-slate-400'  >
        <h1 className='text-white font-bold text-3xl float-left pl-12 pt-8 '>LOGO</h1>
    </div>
    <ul className='float-right -mt-12'>
      {naviList}
    </ul>
    </div>
  )
}
